import styled from 'styled-components';

export const Container = styled.div`
    height: 80px;
    width: 100%;
    background-color: #333;
    display: flex;
    justify-content: center;
    align-items: center;
`;

export const Title = styled.h1`
    margin: 0px;
    color: #fff;
`;
